- input: "TEXT\x1CC00188367\x1CTEXT-00001\x1C\x1CF3XA\x1CThe original 2009 year end
    report included an expenditure dated 12/17/09 in the amount of $250 payable to
    National Stonewall Democrats. This check replaced a check dated 9/21/09 that was
    lost. When the check was reissued we neglected to void the original check. This
    report corrects that error.  The receipts reported on Schedule A Line 15 from
    \ Wyden for Senate, Future PAC, Senate Democratic Leadership Fund and Democratic
    National Committee are offsets for the payment of rent. The Democratic Party of
    Oregon shares office space with several organizations. We write one check to pay
    rent. The amount of rent paid by each organization is assessed at the usual and
    normal charge, determinined by the amount of space occupied by the organization.
    Schedule A Line 15 reflects receipts from various County party committees. The
    Democratic Party of Oregon offers our County Committees a number of technology
    services at cost.  These sevices include website and email services. Payments
    for salaries and wages reported on Schedule H4 are for employees who spent less
    than 25% of their time on FEA or activities in connection with a Federal election.
    Employees who spend more than 25% of their time on FEA or activities in connection
    with a Federal election are paid with 100% Federal funds as are their fringe benefits
    and reported on Line 30b.  This report includes Memo Schedule A entries for contributions
    raised by the Dollars for Democrats, OR Party Victory fund and ASDC Partnership
    Program. The committee may not have received its share of the proceeds as of the
    end of the reporting period. The committee expects to receive transfers at some
    point in the three months following this reporting period.The transfer of the
    joint fundraising proceeds received during this reporting period from the Dollars
    for Democrats Program and OR Party Victoy Fund represents the committee's share
    of proceeds for contributions received during this or prior reporting periods.
    \ The memo entries for these contributions are included in this or a prior report
    of the committee.\n"
